    def dfs(x, y, visited):
        if x < 0 or y < 0 or x >= W or y >= H:
            return True

        if map[y][x] == "#":
            visited[y, x] = True
            return True

        if map[y][x] == ".":
            visited[y, x] = True
            return True

        if map[y][x] == "P" and (x, y) not in visited:
            return True

        if map[y][x] == "G" and (x, y) not in visited:
            return True

        if map[y][x] == "T" and (x, y) not in visited:
            return True

        if map[y][x] == "G" and (x - 1, y) not in visited and (x + 1, y) not in visited and (x, y - 1) not in visited and (x, y + 1) not in visited:
            return True

        if map[y][x] == "T" and (x - 1, y) not in visited and (x + 1, y) not in visited and (x, y - 1) not in visited and (x, y + 1) not in visited:
            return True

        return False

    def get_gold_at(x, y, gold):
        if x < 0 or y < 0 or x >= W or y >= H:
            return 0

        if map[y][x] == "#":
            return get_gold_at(x + 1, y, gold) + get_gold_at(x - 1, y, gold) + get_gold_at(x, y + 1, gold) + get_gold_at(x, y - 1, gold)

        if map[y][x] == "G":
            return gold

        return 0

    gold_start = get_gold_at(0, 0, 0)

    visited = [[False for _ in range(W)] for _ in range(H)]

